postcontent:
I have a performance center S&W 325, Thunder Ranch edition. It is built on Smith's N frame.  The rail is sturdy while on, but can also be removed. The gun is in 97% condition; and, the only blemish on it is the cylinder trail. It comes with the smith and wesson box, a thunder ranch range bag, box, paperwork, dvd, and extras. 

The extras include: a bunch of moon clips;
VZ grips;
Pachmyer grips; 
Hogue grips; 
Factory Smith and wesson Grips;
Hogue cylinder release;
c&s extreme rear sights;
Hi Viz front fiber optic sight; 
apex firing pin kit;
and, of course, I also have all of the original parts.  

I am flexible on value but as a reference price, the gun is going for $1,300.00 on the major arms sites. Additionally, those are selling without any of the extras.  If you have something, or a cash offer, that is in the ball park do not shy away as we can work it out.
